import logo from './logo.svg';
import {Route, Routes, BrowserRouter as Router} from "react-router-dom";
import './App.css';
import Home from './components/Home';

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={Home} />
      </Routes>
    </Router>
  );
}

export default App;
